import React from 'react';
import "./App.css"
const App = () => {
    const list = { display: 'inline' }
    return (
        <>
            <div className="todo_list">
                <h1 className="heading">todo list</h1>
                <div className=''>
                    <input placeholder='this is input field' /><button>Botton</button>
                </div>
                <ul>
                    <div><button>botton</button><li style={list} >this is todo_list</li></div>
                    <div><button>botton</button><li style={list} >this is todo_list</li></div>
                    <div><button>botton</button><li style={list} >this is todo_list</li></div>
                </ul>
            </div>
        </>
    );
}

export default App;
